import React from "react";
import Link from "next/link";
import { useRouter } from "next/router";
import { useGetGame } from "../effects/game";

export default function Header() {
  const router = useRouter();
  const { id } = router.query;
  const [game] = useGetGame(id);
  const joinID = game && game.join_id;

  return (
    <nav className="flex items-center justify-between flex-wrap p-6 border">
      <div className="flex items-center justify-between flex-shrink-0 text-indigo-700 hover:text-indigo-400 mr-6">
        <span className="font-semibold text-xl tracking-tight">
          <Link href="/">
            <a>Darts... Right Now</a>
          </Link>
        </span>
        {joinID && (
          <span className="font-semibold text-xl tracking-tight">
            <span>#</span>
            <span>{joinID}</span>
          </span>
        )}
      </div>
    </nav>
  );
}
